import React from 'react'
import { Chart } from "react-google-charts";

function Piechart({user}) {

  let data = []

  let userTic = user.tickets

  console.log(typeof userTic)

  userTic.forEach(ticket => {
    data.push(ticket.title, ticket.pripority)
  });

  console.log(data)


  return (
    <div>PieChart</div>
  )
}

export default Piechart
